window.bookSummaryJSON = "<p>New Year's Day, 1990. A soldier is found dead in a sleazy motel bed. Jack Reacher is the officer on duty.</p> <p>The soldier turns out to be a two-star general. The situation is bad enough, then Reacher finds the general's wife.</p> <p>This stomach-churning thriller turns back the clock to a younger Reacher, in dogtags. A Reacher who still believes in the service. A Reacher who imposes army discipline. Even if only in his own pragmatic way...</p>"; 
